import './App.css';
import React from 'react';
import Navbar from '../componentes/Navbar'
import {BrowserRouter as Router, Switch} from 'react-router-dom';
import './Apps.css'


function App() {
  return (
    <>
    <Router>
    <Navbar />
    <Switch>
      <Route path='/' exact />
    </Switch>
    </Router>
    </>
  );
}

export default App;
